var Ac4yLifecycleConstant=require("../constant/Ac4yLifecycleConstant.js"); 

var Ac4yLifecycleFact=require("./Ac4yLifecycleFact.js");

class Ac4yLCFStep extends Ac4yLifecycleFact {
    
    constructor(object){
        
        super(object);
        if (object != undefined && object === 0) return;
        
        this.setDimension(new Ac4yLifecycleConstant().DIMENSION.step);

    } // constructor
    
    createSelf(object) {return new Ac4yLCFStep(object);}
    
} // Ac4yLCFStep

module.exports=Ac4yLCFStep
